// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.0;

import "./libs/IWBNB.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";

abstract contract ElvateChest {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    address public WBNBAddress;

    mapping(address => mapping(address => uint256)) public tokens;

    event TokenDeposited(address indexed _owner, uint256 _amount);
    event TokenWithdrew(address indexed _owner, uint256 _amount);

    constructor(address _WBNBAddress) {
        WBNBAddress = _WBNBAddress;
    }

    function depositToken(address _token, uint256 _amount) external {
        IERC20(_token).safeTransferFrom(msg.sender, address(this), _amount);
        tokens[_token][msg.sender] = SafeMath.add(
            tokens[_token][msg.sender],
            _amount
        );
        emit TokenDeposited(msg.sender, _amount);
    }

    function withdrawToken(address _token, uint256 _amount) external {
        tokens[_token][msg.sender] = SafeMath.sub(
            tokens[_token][msg.sender],
            _amount
        );
        IERC20(_token).safeTransfer(msg.sender, _amount);
        emit TokenWithdrew(msg.sender, _amount);
    }

    function getDepositedToken(address _owner, address _token)
        public
        view
        returns (uint256)
    {
        return tokens[_token][_owner];
    }

    function deposit() external payable {
        IWBNB(WBNBAddress).deposit{value: msg.value}();
        tokens[WBNBAddress][msg.sender] = SafeMath.add(
            tokens[WBNBAddress][msg.sender],
            msg.value
        );
        emit TokenDeposited(msg.sender, msg.value);
    }
}
